// directive
import {
    ReadMoreDirective,
} from 'app/entities/providencia/read-more.directive';

const ENTITY_STATES = [...providenciaRoute, ...providenciaPopupRoute];

// @ts-ignore
@NgModule({
    imports: [
        Ng2Rut,
        PdisciplinarioSharedModule,
